import React from "react";
import { mapIcon } from "../assets/icons";

const iconWithInfo = [
  {
    svg: "mapIcon",
    info: "16 Liffey Ave, Liffey Valley Park, Lucan,Co. Dublin, K78 HW50, Ireland",
  },
  {
    svg: 'callIcon',
    info:'hello@earthly.ie'
  },
  { 
    svg:'callIcon'
  }
];

const ContactUs = () => {
  return (
    <div>
      <div className="flex w-full min-h-screen bg-primaryThree justify-center items-center">
        <div className="flex flex-col justify-between ">
          <div>
            <h1 className="font-[itim] text-4xl tracking-tight">Contact us</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
